    //                             note: "",
    //                             is_active: true,
    //                             created_at: "2021-09-10T04:29:28.450457Z",
    //                             updated_at: null,
    //                             attribute_group: "0a80cace-83c3-4af3-8e91-25f02a75a19a"
    //                         }
    //                     ],
    //                     "detail": {
    //                         "attribute_group_id": "0a80cace-83c3-4af3-8e91-25f02a75a19a",
    //                         "is_default_group": false,
    //                         "attribute_group_code": "workload_clinical_activities_administration",
    //                         "attribute_group_name": "Administration  (e.g., protocol, process, meetings, etc.)",
    //                         "created_at": "2021-09-10T01:50:44.855237Z",
    //                         "attribute_set_id": "38a60d84-4746-4375-a66e-bb039260833a",
    //                         "parent_attribute_group": "05283820-9aa4-4da5-bca1-3ce26f8eb618"
    //                     }
    //                 },
    //                 "workload_case_management_review_board": {
    //                     "attributes": [],
    //                     "detail": {
    //                         "attribute_group_id": "bba7b54f-4caf-4fb8-baeb-f4d5b17802a8",
    //                         "is_default_group": false,
    //                         "attribute_group_code": "workload_case_management_review_board",
    //                         "attribute_group_name": "Case Management Review Board",
    //                         "created_at": "2021-09-10T01:49:28.644000Z",
    //                         "attribute_set_id": "38a60d84-4746-4375-a66e-bb039260833a",
    //                         "parent_attribute_group": "05283820-9aa4-4da5-bca1-3ce26f8eb618"
    //                     }
    //                 }
    //             },
    //             "detail": {
    //                 "attribute_group_id": "05283820-9aa4-4da5-bca1-3ce26f8eb618",
    //                 "is_default_group": false,
    //                 "attribute_group_code": "workload_project_clinical_activities",
    //                 attribute_group_name": "Project Related Clinical Activities ",
    //                 created_at: "2021-09-10T01:46:14.239449Z",
    //                 attribute_set_id: "38a60d84-4746-4375-a66e-bb039260833a",
    //                 parent_attribute_group: null
    //             }
    //         }
    //     }
    // }

    return (
        <Grid container spacing={gridSpacing}>
            <Grid item xs={12} lg={6}>
                <MainCard title="Client Caseload">
                    <Grid container spacing={2} alignItems="center">
                        <Grid item xs={12}>
                            <Grid container spacing={2} alignItems="center">
                                <Grid item xs={12} sm={3} lg={4} sx={{ pt: { xs: 2, sm: '0 !important' } }}>
                                    <InputLabel horizontal> Number of Clients</InputLabel>
                                </Grid>
                                <Grid item xs={12} sm={9} lg={6}>
                                    <TextField fullWidth placeholder="1" />
                                    <FormHelperText>Please enter your full name</FormHelperText>
                                </Grid>
                                <Grid item xs={12} sm={3} lg={4} sx={{ pt: { xs: 2, sm: '0 !important' } }}>
                                    <InputLabel horizontal>Total time spent </InputLabel>
                                </Grid>
                                <Grid item xs={12} sm={9} lg={6}>
                                    <TextField fullWidth placeholder="1" />
                                    <FormHelperText>Total time spent</FormHelperText>
                                </Grid>
                            </Grid>
                        </Grid>
                    </Grid>
                </MainCard>
            </Grid>

            <Grid item xs={12} lg={6}>
                <MainCard title="Project Related Clinical Activities ">
                    <Grid container spacing={2} alignItems="center">
                        <Grid item xs={12}>
                            <Typography variant="h5" component="div" sx={{ mb: 3 }}>
                                Case Management Review Board
                            </Typography>
                            <Grid container spacing={2} alignItems="center">
                                <Grid item xs={12} sm={3} lg={4} sx={{ pt: { xs: 2, sm: '0 !important' } }}>
                                    <InputLabel horizontal>Total time spent</InputLabel>
                                </Grid>
                                <Grid item xs={12} sm={9} lg={6}>
                                    <TextField fullWidth placeholder="1" />
                                    <FormHelperText>Total time spent</FormHelperText>
                                </Grid>
                            </Grid>
                        </Grid>
                        <Grid item xs={12}>
                            <Grid container spacing={2} alignItems="center">
                                <Grid item xs={12}>
                                    <Typography variant="h5" component="div" sx={{ mb: 3 }}>
                                        Administration (e.g., protocol, process, meetings, etc.)
                                    </Typography>
                                    <Grid container spacing={2} alignItems="center">
                                        <Grid item xs={12} sm={3} lg={4} sx={{ pt: { xs: 2, sm: '0 !important' } }}>
                                            <InputLabel horizontal>Total time spent</InputLabel>
                                        </Grid>
                                        <Grid item xs={12} sm={9} lg={6}>
                                            <TextField fullWidth placeholder="1" />
                                            <FormHelperText>Total time spent</FormHelperText>
                                        </Grid>
                                    </Grid>
                                </Grid>
                            </Grid>
                        </Grid>
                        <Grid item xs={12}>
                            <Grid container spacing={2} alignItems="center">
                                <Grid item xs={12}>
                                    <Typography variant="h5" component="div" sx={{ mb: 3 }}>
                                        Other
                                    </Typography>
                                    <Grid container spacing={2} alignItems="center">
                                        <Grid item xs={12} sm={3} lg={4} sx={{ pt: { xs: 2, sm: '0 !important' } }}>
                                            <InputLabel horizontal>Details</InputLabel>
                                        </Grid>
                                        <Grid item xs={12} sm={9} lg={6}>
                                            <TextField fullWidth placeholder="Other Porject details" />
                                        </Grid>
                                    </Grid>
                                </Grid>
                            </Grid>
                        </Grid>
                    </Grid>
                </MainCard>
            </Grid>

            <Grid item xs={12}>
                <MainCard title="3 Columns Form Layout">
                    <Grid container spacing={2} alignItems="center">
                        <Grid item xs={12} lg={4}>
                            <Grid container spacing={2} alignItems="center">
                                <Grid item xs={12} sm={3} lg={4} sx={{ pt: { xs: 2, sm: '0 !important' } }}>
                                    <InputLabel horizontal sx={{ textAlign: { xs: 'left', sm: 'right' } }}>
                                        Name :
                                    </InputLabel>
                                </Grid>
                                <Grid item xs={12} sm={9} lg={8}>
                                    <TextField fullWidth placeholder="Enter full name" />
                                    <FormHelperText>Please enter your full name</FormHelperText>
                                </Grid>
                            </Grid>
                        </Grid>
                        <Grid item xs={12} lg={4}>
                            <Grid container spacing={2} alignItems="center">
                                <Grid item xs={12} sm={3} lg={4} sx={{ pt: { xs: 2, sm: '0 !important' } }}>
                                    <InputLabel horizontal sx={{ textAlign: { xs: 'left', sm: 'right' } }}>
                                        Email :
                                    </InputLabel>
                                </Grid>
                                <Grid item xs={12} sm={9} lg={8}>
                                    <TextField fullWidth placeholder="Enter email" />
                                    <FormHelperText>Please enter your Email</FormHelperText>
                                </Grid>
                            </Grid>
                        </Grid>
                        <Grid item xs={12} lg={4}>
                            <Grid container spacing={2} alignItems="center">
                                <Grid item xs={12} sm={3} lg={4} sx={{ pt: { xs: 2, sm: '0 !important' } }}>
                                    <InputLabel horizontal sx={{ textAlign: { xs: 'left', sm: 'right' } }}>
                                        Password :
                                    </InputLabel>
                                </Grid>
                                <Grid item xs={12} sm={9} lg={8}>
                                    <TextField
                                        type="password"
                                        fullWidth
                                        placeholder="Enter Password"
                                        InputProps={{
                                            startAdornment: (
                                                <InputAdornment position="start">
                                                    <LockTwoToneIcon />
                                                </InputAdornment>
                                            )
                                        }}
                                    />
                                    <FormHelperText>Please enter Password</FormHelperText>
                                </Grid>
                            </Grid>
                        </Grid>
                        <Grid item xs={12}>
                            <Divider />
                        </Grid>
                        <Grid item xs={12} lg={4}>
                            <Grid container spacing={2} alignItems="center">
                                <Grid item xs={12} sm={3} lg={4} sx={{ pt: { xs: 2, sm: '0 !important' } }}>
                                    <InputLabel horizontal sx={{ textAlign: { xs: 'left', sm: 'right' } }}>
                                        Contact :
                                    </InputLabel>
                                </Grid>
